import User from "./components/user/user";
import Task from "./components/task/task";
import Card from "./components/cards/card";
import Navbar from "./shared/compoents/navbar";


import { BrowserRouter as Router,Route,Routes,Navigate } from "react-router-dom";
import ProductForm from "./components/product/product_form/product_form";
import ShowProduct from "./components/product/show_product/showProduct";
import ProductCard from "./components/product/show_product/product_card";

import './App.css'
const data = ['tea', 'coffee', 'water']

function App() {

  let title="Bobby";

  return (


   <React.Fragment>
      <Navbar />

      <Router>
      <Routes>

<Route path="/" exact element={<ProductForm/>}>



        {/* <ProductCard/> */}
            {/* <Card title="Bobby"></Card> */}

          </Route>

      <Route path="/form"  >



      </Route>



          <Route path="/home" exact>

            <Task/>

          </Route>



          <Route path="/prodForm" exact>

          <ProductForm name="Bobby"/>

          </Route>


          <Route path="/showProd" exact>

          <ShowProduct/>

          </Route>





          <Route path="/create" exact>
            <User data={data}/>
          </Route> 

          <Navigate to="/"/>




          </Routes>

        </Router>


        </React.Fragment>









  );
}

export default App;
